    [],nt"revision_timestamp": "2016-07-27T22:56:28.475634",nt"name": "cropland-and-grassland-management-plan-prime-hook-national-wildlife-refuge-1987",nt"isopen":
    false,nt"url": null,nt"notes": "A major wildlife objective for the Prime
    Hook National Wildlife Refuge is the production of food for Canada geese during
    the fall migration, winter and spring migration. Crops are planted to furnish additional
    food for waterfowl. A second important refuge wildlife objective is duck production.
    Grasslands and croplands in the grass/clover stage of rotation provide important
    nesting habitat for ducks, especially adjacent to the marsh. The use of agricultural
    lands for crop production prevents the invasion of brush and the loss of open habitats.
    Management of grasslands also helps to prevent invasion of brush. A third important
    refuge wildlife objective is providing habitat for the endangered Delmarva Fox Squirrel.",nt"license_title":
